import React from 'react';
import Product from "./Product";

const ProductList = (props) => {
    const { productsProps } = props;

    console.log("ProductList ", props);

    return (
        <div>
            {productsProps.map(product => (
                <Product
                    key={product.id}
                    product={product}
                />
            ))}
        </div>
    )
}

export default ProductList
